import React from 'react'
import Graph from 'react-vis-network-graph'
import { edges, nodes } from './databas'

export default function WorldCup() {
    
    var options = {
        nodes:{
            shape: "dot",
            scaling: {
                min: 5,
                max: 50,
                label: {
                    min: 6,
                    max: 24,
                    drawThreshold: 8,
                    maxVisible: 16,

                }
            },
            font: {
                size: 12,
                face: "Arial",
                color:"white"
            }
        },
        edges: {
            width: 0.2,
            color: {inherit: "from"},
            smooth: {
                type: "dynamic"
            }
        },
        physics: true,
        interaction: {
            navigationButtons: false,
            tooltipDelay: 300,
            hideEdgesOnDrag: false,
            hideEdgesOnZoom: false
        },
        height: "800px"
    };
    var data = { nodes: nodes, edges: edges };

    return (
        <div className='container'>
            <Graph
                graph={data}
                options={options}
            />
        </div>
    )
}
